import Particles from 'react-particles-js';
//import logo from './logo.svg';
import './App.css';

class App extends Component{
  render() {
    return(
      <Particles 
              params={{
                particles: {
                  line_linked: {
                    shadow: {
                      enable: true,
                      color: "#3CA9D1",
                    }
                  }
                }
              }}
              style={{
                width: '100%',
                //backgroundImage: `url(${logo})` 
              }}
            />
    )
  };
}

export default App;
